import styled from 'styled-components';

export const ProductsBox = styled.div`
  width: 100%;
  padding: 30px;
  background-color: #efefef;
  border: 3px solid #1e2e5e;
  border-radius: 10px;
  overflow: scroll;
`;

export const List = styled.ul`
  display: flex;
  gap: 30px;
  flex-wrap: wrap;
  justify-content: center;
`;
